export default function Header() {
	return (
	<header className="inline-flex space-x-4">
		<nav>
			<a href="/">Home</a>
			<a href="/about">About</a>
		</nav>
		<img src="/icons/logo.png" alt="Luna Logo" />
		<nav>
			<a href="/shop">Shop</a>
			<a href="/contact">Contact</a>
		</nav>
	</header>
	);
}
